import React from 'react'
import { StyleSheet, Text, View } from 'react-native'

const Loginpage = () => {
    return (
        
        <View>
<Image
  source={require("./assets/login1.png")}
  
/>
            <Text>Login page</Text>
        </View>
    )
}

export default Loginpage

const styles = StyleSheet.create({})
